import React from 'react';

const style = `
.header {
  height: 50vh;
  width: 80%;
  background: url(<iframe src="https://giphy.com/embed/ZcdJJvDqTgdGZK8Xd3" width="480" height="480" frameBorder="0" class="giphy-embed" allowFullScreen></iframe><p><a href="https://giphy.com/gifs/visuals-network-fiber-optics-ZcdJJvDqTgdGZK8Xd3) repeat center;
  background-size: cover;

}
`;

const Header = () => {
  return (
    <div className="header">
      <style>{style}</style>
    </div>
  );
};

export default Header;
